import React, { Component } from 'react';
import './App.css';

import Header from './components/header/Header'
import Instruction from './components/instructions/Instruction'

class App extends Component() {
  render(){
    return(
    <div className="App">
      <Header headerName = "Clicky Game"/>
      <Instruction/>
    </div>
    )};
}

export default App;
